import React from 'react';
import NavigationBar from './NavigationBar';

import { BrowserRouter, Route } from "react-router-dom";
import Home from "./pages/Home"

function App() {
  return (
    <BrowserRouter>
      <NavigationBar></NavigationBar>
      <Route path = "/" component = {Home} />
    </BrowserRouter>
  );
}

export default App;
